import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom";
import Menu from './Menu';

function App() {

  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route index element={<Menu/>}/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
